const WikiModal = ({ onClose }) => {
  const [category, setCategory] = useState('dogs');

  return (
    <div className="wiki-overlay" onClick={onClose}>
      <div className="wiki-content" onClick={(e) => e.stopPropagation()}>
        
        <button className="close-wiki" onClick={onClose}><X size={24}/></button>
        <h2 className="wiki-title">Animal Encyclopedia</h2>
        <p className="wiki-sub">Select a category to learn about breeds.</p>

      
        <div className="wiki-tabs">
          <button className={`tab-btn ${category === 'dogs' ? 'active' : ''}`} onClick={() => setCategory('dogs')}>
            <Dog size={18}/> Dogs
          </button>
          <button className={`tab-btn ${category === 'cats' ? 'active' : ''}`} onClick={() => setCategory('cats')}>
            <Cat size={18}/> Cats
          </button>
          <button className={`tab-btn ${category === 'birds' ? 'active' : ''}`} onClick={() => setCategory('birds')}>
            <Bird size={18}/> Birds
          </button>
        </div>

       
        <div className="wiki-list-wrapper">
            <div className="wiki-list">
            <div className="list-header">
                <span>Photo</span>
                <span>Breed Name</span>
                <span>Lifespan</span>
                <span>Trait</span>
            </div>
            {wikiData[category].map((item, index) => (
                <div key={index} className="wiki-item">
                <div className="w-img-box">
                    <img src={item.img} alt={item.name} />
                </div>
                <span className="w-name">{item.name}</span>
                <span className="w-life">{item.life}</span>
                <span className="w-trait">{item.trait}</span>
                </div>
            ))}
            </div>
        </div>
      </div>
    </div>
  );
};
export default WikiModal;